import "./Layout.css";
import styled from "styled-components";
import Menu from "../Menu/Menu";
import Header from "../Header/Header";
import Routing from "../Routing/Routing";

function Layout(): JSX.Element {
  return (
    <StyledLayout>
      <StyledMenu />
      <StyledHeader />
      <StyledRouting />
    </StyledLayout>
  );
}

export default Layout;
